class Solution {
    public int minOperations(List<Integer> nums, int target) {
        long sum = 0;
        Map<Integer, Integer> count = new HashMap<>();
        for (int num : nums) {
            sum += num;
            for (int i = num; i > 0; i >>= 1) {
                count.put(i, count.getOrDefault(i, 0) + 1);
            }
        }
        if (sum < target) return -1;
        if (sum == target) return 0;

        int operations = 0;
        for (int i = 30; i >= 0; i--) {
            int val = 1 << i;
            if ((target & val) != 0) {
                if (count.getOrDefault(val, 0) == 0) {
                    return -1;
                }
                count.put(val, count.get(val) - 1);
            }
            int nextVal = val << 1;
            int available = count.getOrDefault(val, 0);
            count.put(nextVal, count.getOrDefault(nextVal, 0) + available / 2);
            if (available % 2 != 0 && val != 1) {
                operations += 1;
            }
        }
        return operations;
    }
}
